import Paper from "@material-ui/core/Paper";

import FormStyles from "../styles/Form.module.scss";

const styles = {
  MuiPaper: {
    display: "flex",
    alignItems: "center",
    position: "absolute",
    top: 162,
    width: "100%",
    height: 128,
    backgroundColor: "rgba(26, 120, 194, 1)",
    padding: 40,
    boxSizing: "border-box",
  },
  AccountIcon: {
    width: 80,
    height: 80,
  },
};

export default function Form() {
  return (
    <section className="Form">
      <Paper style={styles.MuiPaper}>
        <div className={`${FormStyles.UserIcon} UserIcon`} />
      </Paper>
    </section>
  );
}
